import React, { Component } from 'react';
import Clients from './clients/Clients';

export class Dashboard extends Component {
  render() {
    return (
      <div>
         <h1 style={{fontSize:'40px'}}>Clients</h1>
        <hr/>
         <Clients />
      </div>
    )
  }
}

export default Dashboard
